import React from 'react';
import './style.css';
import Header from './components/Header';
import Anasayfa from './components/Anasayfa';
import Hakkimizda from './components/Hakkimizda';
import Iletisim from './components/Iletisim';
import Profil from './components/Profil';
import Uyeler from './components/Uyeler'
import UyeDetay from './components/UyeDetay'
import {BrowserRouter as Router, Switch,Route } from 'react-router-dom';
import { MainContext } from './api/MainContext';

function App() {
    const test =  "selam context api"

    const data = {
        test
    }

    return ( 
        <div className="app">
        <Router>
                <Header/>
               <Switch>
                   <MainContext.Provider value={data}>
                    <Route path="/" exact component={Anasayfa} />
                    <Route path="/hakkimizda" component={Hakkimizda} />
                    <Route path="/iletisim" component={Iletisim} />
                    <Route path="/profil" component={Profil} />
                    <Route path="/uyeler" exact component={Uyeler}/>
                    <Route path="/uyeler/:id" component={UyeDetay} />
                   </MainContext.Provider>
               </Switch>
        </Router>
        </div>   
    )
}

export default App;
